import React from "react";
import "./NavBar.css";

const NavBar = () => {
  return (
    <ul className="navbar">
      <li>
        <a>Home</a>
      </li>
      <li>
        <a>Leagues</a>
        <ul>
          <li>English Premier Leauge</li>
          <li>Spanish La Liga</li>
          <li>Italian Serie A</li>
          <li>German Buendes Leauge</li>
        </ul>
      </li>
      <li>
        <a>Scorers</a>
      </li>

      <li>
        <a>Sign up</a>
      </li>
    </ul>
  );
};

export default NavBar;
